const CREATE = "user/CREATE";
const LOAD = "user/LOAD";

export const CreateUser = (ranking) => {
  return { type: CREATE, ranking };
}

export const LoadUser = (ranking_list) => {
  return { type: LOAD, ranking_list};
}

//Reducer
export default function reducer(state = initState, action = {}) {
  switch (action.type) {
    case "user/LOAD" : {
      return{state, ranking:action.ranking}
    }
    case "user/CREATE": {
      const new_rank = [...state.rank, action.ranking];
      return { rank: new_rank };
    }

    default:
      return state;
  }
}
